onunda  birlikten atÄ±lma durumu yaÅŸarsÄ±nÄ±z..\r\n\nÄ°naktif kalmanÄ±z gerekiyorsa Discord Ã¼zerinden #inaktiflik-bildirme kanalÄ±nÄ± Ã¼zerinden bildirmelisiniz.\r\n\nFaction Chat sohbet alanÄ± deÄŸildir. Selam vb. gibi konuÅŸmalar yasaktÄ±r. UyarÄ± alÄ±rsÄ±nÄ±z.\r\n\n\n\nKomutlar:\r\n\r\n /togspeed ( HÄ±z Limiti Ayarlama kodu )\r\n /togspeed 60 [ Ä°deal HÄ±z Limiti Kodudur ] (Uzun yollarda hÄ±z sÄ±nÄ±rÄ± 90dÄ±r, Taksim CDsi gibi.)\r\n\r\n /rbs  ( Bariyer koyma menÃ¼sÃ¼nÃ¼ aÃ§ar )\r\n /delrb id ( RBS Silme komutudur, ilk koyduÄŸunuz RBS id 1den baÅŸlar )\r\n /nearbyrb\r\n /yt [Yaka Telsizi]  [Sadece 25-35 metre  iÃ§in geÃ§erlidir, fazlasÄ±na sinyal yetiÅŸmez]\r\n /t [Telsiz]  [KullandÄ±ÄŸÄ±n aracÄ±n plakasÄ±, Durumun ve kodun, BulunduÄŸun konum]\r\n\r\n /destek (Destek Ã§aÄŸÄ±rmak iÃ§in gerekli koddur.)\r\n /takip (Ã‡aÄŸÄ±rÄ±lan desteÄŸe yÃ¶nelme kodudur.)\r\n /panik (Acil durum bildirmek, /destek durumu ile bildirmek.)\r\n\r\n>>KiÅŸiye ceza kesmek:\r\n /ticket [Player Name/ID] [Miktar] [Plaka - Sebep]\r\n\r\n>>PANÄ°K BUTONU (/panik)\r\nBu komutun kullanÄ±mÄ±nÄ± suistimal edenler hakkÄ±nda resmi telsiz trafiÄŸini meÅŸgul etmekten uyarÄ± yazÄ±lÄ±r.\r\nLÃ¼tfen bu komutu sadece son Ã§are olarak kullanÄ±n.\r\nBirden fazla memuru iÃ§eren olaylarda basmayÄ±n.(Ä°ki kiÅŸide basabilirsiniz)\r\n-AÄŸÄ±r silah iÃ§eren KOD0 baÅŸlangÄ±cÄ±nda (AK47, M4, Rifle) bir kez basÄ±lmak suretiyle kullanÄ±lacak, KOD0 bildirgesi telsizden geÃ§ilecek.\r\n-Pusuya dÃ¼ÅŸÃ¼rÃ¼lme anÄ±nda, KOD0 bildirgesi ile birlikte panik butonuna basÄ±lacak.\r\n-Memuru kaÃ§Ä±rmaya teÅŸebbÃ¼ste bir kez olacak ÅŸekilde telsiz kullanÄ±lmadan basÄ±lacak.\r\n-Tehlikeli bÃ¶lgelerde herhangi bir eylemle karÅŸÄ±laÅŸÄ±ldÄ±ÄŸÄ± zaman veya polis aracÄ±nÄ±n etrafÄ± ciddi bir ÅŸekilde sarÄ±ldÄ±ÄŸÄ± zaman Ã¶ncÃ¼ birim tarafÄ±ndan basÄ±lacak.\r\n\r\n>>Åžerit yerleÅŸtirmek.\r\n /serit basla yaparak ÅŸeriti uygun bir biÃ§imde dizilir, iÅŸlem bittikten sonra /serit bitir yazarak ÅŸeritinizi aktif hale getirirsiniz.\r\n /serit sil id yazarak ÅŸeritinizi kalÄ±cÄ± olarak kaldÄ±rabilirsiniz.\r\n\r\n---------------------------------------------------------------------------------------------------------------------------------------------------------\r\n\n\r\nTelsiz ve Megafon ProsedÃ¼rleri\r\n((Konum otomatik olarak veriliyor))\r\n\r\n1-) GÃ¶rev BaÅŸlangÄ±cÄ± ;\r\n[Rozet kodunuz]  [Ekip Kodunuz] ile  gÃ¶rev baÅŸlangÄ±cÄ±.\n\r\n2-) Ã–rnek GÃ¶rev BaÅŸlangÄ±cÄ± Telsizi .\r\n10001 , 10002  1-ADAM-1 ile gÃ¶rev baÅŸlangÄ±cÄ±.\n\n3-) Trafic Stop telsizi ;\r\n[Ekip kodunuz] [AraÃ§ Rengi] , [AraÃ§ MarkasÄ±] iÃ§in trafik durdurmasÄ±  baÅŸlangÄ±cÄ± , [BÃ¶lgeniz] , [AraÃ§ DÄ±ÅŸÄ±]\n\r\n4-)Ã–rnek Trafic Stop Telsizi ;\r\n1-ADAM-1; SarÄ± Sultan iÃ§in trafik durdurmasÄ± baÅŸlangÄ±cÄ± , Idlewood, araÃ§ dÄ±ÅŸÄ±ndayÄ±m.\n\n\n\n', null, '20');
INSERT INTO `factions` VALUES ('2', 'Los Santos Medical Department', '999997', '4', 'Ä°zinli/CezalÄ±', 'Medic of Training', '-', '-', '-', '-', '-', '-', '-', '-', 'Medic of Training', '-', 'EMT', 'Paramedic', 'Senior Paramedic', 'Head of EMS', '-', 'Practitioner Doctor', 'Expert Doctor', 'Operation Doctor', '0', '0', '0', '0', '75', '350', '200', '500', '600', '675', '750', '775', '800', '950', '950', '950', '1100', '1200', '1300', '2500', 'Radio Frequency: 115.001 || Remember to show the best whilst on duty, failure to do so will result in disciplinary action || 7+ days of inactivity = boot || Training date TBA - Check the forums daily!', '----------\nBadges\n---------\nissuebadge ID LSES || RÃœTBE || ROZET KODU ||  -- SÄ°LME BURAYI ROZET VERME KODU\nÃ–rnek ; issuebadge 1 LSES || Supervisor || #004 ||    -- SÄ°LME BURAYI ROZET VERME KODU\n----------\nTraining\n-----------\n\n\n-------------------------------\nPromotion Suggestions\n-------------------------------\n\n\n\n-----------------------------\nAdministrative Details\n-----------------------------\n\n\n----------------------------\nAdvertisements\n-----------------------------\n\n\n--------------------------------------\nAuthorised Strobes\n--------------------------------------\n\n\n\n', 'PRESS RELEASES\n-------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\nDon\'t sell faction equipment (Gas masks, medical bags, duty belt\'s) You will be removed from LSFD and administrative action will be taken I.E. Jails/Warns/Bans.\nIMPORTANT: If you want to request strobbes for your personal vehicle, talk to Jason Heywood first!! Only FF/EMT B+ can apply for those.\n-------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\nBadge numbers:\n-------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n**BURAYA ROZET NUMARALARINI VE Ä°SÄ°MLERÄ°NÄ° YAZINIZ**\n**Ã–rnek; #004 - Minel Lima**\n**Okuduktan Sonra LÃ¼tfen Bu MesajÄ± Siliniz**\n\n\n-------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\nSub Units/Requirments:\n\nSearch and Rescue - Firefighter/EMT B\nHazardous Materials - Firefighter/EMT A\nFire Inspection Unit - Firefighter/EMT I\n-------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\nRadio Communications\n\nFrequency: 115.001\n\n10-CODES/Radio Codes:\r\n\r\n\r10-1: Roll Call, all units respond to said location.\r\n\r\r10-2: Arrived on scene.\r\n\r10-3: Negative / No\r\n\r10-4: Acknowledgement / Affirmative / Yes\r\n\r10-5: Repeat last transmission\r\n\r10-6: Stand-by\r\n\r10-7: Unavailable for calls\r\n\r10-8: Available for calls\r\n\r10-9: Suspect Lost (Usually followed by a 10-17 and 10-22)\r\n\r10-10: (Supervisors only) requesting activity update along with giving your current position\r\n\r10-12: Backup Required (Specify situation and location)\r\n\r10-13: Requesting specific unit (specify) \r\n\r10-17: Requesting description on the suspect\r\n\r10-20: Requesting Location\r\n\r10-22: Disregard last transmission\r\n\r10-30: Starting Patrol/Resuming patrol after Code 7\r\n\r\r10-31: Returning to Station\r\n\r10-44: Coffee Break\r\n\r10-50: Car accident\r\n\r10-55: Traffic Stop\r\n\r10-57 Victor: Vehicle pursuit.\r\n\r\r10-57 Foxtrot: Foot pursuit.\r\n\r10-66: Felony Stop\r\n\r10-88 Suspicious Person(s)\r\n\r10-99: Assignment complete (State condition and at what call)\r\n\r\r11-99: Officer requires help, Emergency\r\n\r\n\rStatus-codes:\r\n\rStatus 1: In Service\r\n\rStatus 2: Out of Service\r\n\r\n\r\rIdentity Codes:\r\n\r\rIC-1: White\r\n\r\rIC-2: Black\r\n\r\rIC-3: Latino or Mexican\r\n\r\rIC-4: Middle-Eastern\r\n\r\rIC-5: Asian\r\n\r\rIC-6: Unknown ethnicity.\r\n\r\nSituation codes:\r\n\r\rCode 0: Absolute emergency, drop everything youâ€™re doing and respond immediately.\r\n\r\rCode 1: Non-emergency. If you\'re doing something, deal with it first. Respond without lights or sirens.\r\n\r\rCode 2: Non-emergency. If you\'re doing something, drop it and respond. Respond with lights only.\r\n\r\rCode 3: There is an emergency. Respond with lights and sirens.\r\n\r\rCode 4: No assistance required, situation under control.\r\n\r\rCode 5: All units stay out of <location>.\r\n\r\rCode 6: Out of car at <location>.\r\n\rCode 7: Meal break.\r\n\n-------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nBASIC LIFE SUPPORT (BLS)\n\nBasic life support (BLS) is the level of medical care which is used for victims of life-threatening illnesses or injuries until they can be given full medical care at a hospital. It can be provided by trained medical personnel, including emergency medical technicians, paramedics, and by laypersons who have received BLS training. BLS is generally used in the pre-hospital setting, and can be provided without medical equipment.\n\nCirculation: providing an adequate blood supply to tissue, especially critical organs, so as to deliver oxygen to all cells and remove metabolic waste, via the perfusion of blood throughout the body.\r\n\nAirway: the protection and maintenance of a clear passageway for gases (principally oxygen and carbon dioxide) to pass between the lungs and the atmosphere.\r\n\nBreathing: inflation and deflation of the lungs (respiration) via the airway\r\n\n-------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nADVANCED LIFE SUPPORT (ALS)\n\nAdvanced Life Support (ALS) is a set of life-saving protocols and skills that extend Basic Life Support to further support the circulation and provide an open airway and adequate ventilation (breathing).\nBLS Includes But Is NOT Limited To:\n\nTracheal intubation\r\n\nRapid sequence intubation\r\n\nCardiac monitoring\r\n\nCardiac defibrillation\r\n\nTranscutaneous pacing\r\n\nIntravenous cannulation (IV)\r\n\nIntraosseous (IO) access and intraosseous infusion\r\n\nSurgical cricothyrotomy\r\n\nNeedle cricothyrotomy\r\n\nNeedle decompression of tension pneumothorax\r\n\nAdvanced medication administration through parenteral and enteral routes (IV, IO, PO, PR, ET, SL, topical, and transdermal)\r\n\nAdvanced Cardiac Life Support (ACLS)\r\n\nPediatric Advanced Life Support (PALS) or Pediatric Education for Pre-Hospital Providers (PEPP)\r\n\nPre-Hospital Trauma Life Support (PHTLS), Basic Trauma Life Support (BTLS) or International Trauma Life Support (ITLS)\r\n\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\nFIREFIGHTERS TOOLS\n\n((The Chainsaw acts as most of the cutting/breaking tools below))\n\nBasic:\n\nFire Extinguisher (Portable device used to extinguish small fires)\nAxe (Used to break doors down)\nSCBA Gear(Self-Contained Breathing Apparatus) (Compressed air that MUST be worn when dealing with a fire)\nLadder (Used to climb up places)\nSand Bucket (Used to spread on the floor to prevent fire spreading I.E. Fuel. Also used to dry oil up)\nJaws of Life ((Chainsaw)) (Used to cut metal or other materials)\nHalligan Tool (Sharp Iron bar used to break things open (can be classed as advanced)\n\nAdvanced:\n\nHoseline (A long rubber, flexible tube used to run water though)\nFemale-Male Link (Used to connect another female-male hoseline to allow water to run though)\nHalligan Tool (Sharp Iron bar used to break things open (can be classed as basic)\n\n---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\n\n\n\n\n\n\n\n', null, '20');
