zmet tÃ¼rÃ¼nÃ¼ gÃ¶sterir:\r\n\r\n(A)DAMS - Klasik istasyon devriyesi (partnerli)\r\nC - Captain (partnerli/partnersiz)\r\nL - Lieutenant (partnerli/partnersiz)\r\n(K)ING - Klasik istasyon devriyesi (partnersiz)\r\nM - Motorlu birim devriyesi(partnersiz)\r\nE - HÄ±z birimi devriyesi(partnerli/partnersiz)\r\n(R)ESCUE - SEB Emergency Services Detail\r\nT - Trafik Birim devriyesi (partnerli/partnersiz)\r\nU - Utility (SUV) (partnerli/partnersiz)\r\nW - SEB (SEB Special Enforcement Detail)\r\nTakip (Pursuit)\r\nBir birim bir araca veya yaya takibe dahil olduÄŸunda, takipte olduklarÄ±nÄ± ve aracÄ±n, plaka veya takip nedenini, mevcut lokasyonu (veya bir yaya takip ise olayÄ±) belirtmelidir. AyrÄ±ca birim, bir hava Ã¼nitesi ve bir sÃ¼pervizÃ¶rÃ¼n yanÄ± takip iÃ§in hangi radyo-taktik kanalÄ±n kullanÄ±lacaÄŸÄ±nÄ± bildirir. Ä°zleme sÄ±rasÄ±nda iletiÅŸim kurarken, sokak isimlerini kullanmanÄ±z gerekir. Yer iÅŸaretleri kullanÄ±ldÄ±ÄŸÄ± sÃ¼rece sokak adlarÄ± kullanÄ±lmaya devam edilebilir.\r\n13. DEPARTMANLAR ARASI TELSÄ°Z KULLANIMI. Departmanlar arasÄ± frekans, memurlar tarafÄ±ndan diÄŸer kurumlarla iletiÅŸim kurmak iÃ§in kullanÄ±labilir. BaÅŸka bir ajansla iletiÅŸim kurmak isteyen gÃ¶revliler bir danÄ±ÅŸman talep eder ve bÃ¶lÃ¼mler arasÄ± frekans konusunda kendi adlarÄ±na iletiÅŸim kurmalarÄ±nÄ± ister. Memurlar bÃ¶lÃ¼mler arasÄ± frekansÄ± yalnÄ±zca aÅŸaÄŸÄ±daki durumlarda kullanabilirler:\r\nâ€¢ Fire Department\'den yardÄ±m talep etme durumlarÄ±\r\nâ€¢ San Andreas County Jail\'e giriÅŸ saÄŸlanÄ±rken\r\nâ€¢ Ã–zel olarak temasa geÃ§ebilirler (isim, birim veya seri numarasÄ± vb. ile)\r\nâ€¢ Bir sÃ¼pervizÃ¶r ile temasa geÃ§mek iÃ§in kullanabilirler ve yanÄ±t bekleyebilirler\r\nâ€¢ Bir amir tarafÄ±ndan iletiÅŸim kurulmasÄ± istenebilir\r\n\r\nDepartmanlar arasÄ± telsiz kullanÄ±rken, memurlar:\r\nâ€¢ Kendinizi \"SHERIFF\" olarak tanÄ±mlayÄ±n ve ardÄ±ndan telsiz baÅŸlangÄ±cÄ±nda seri numaranÄ±zÄ± bildirin yayÄ±nÄ±n yÃ¶nlendirildiÄŸi ajansÄ± sÃ¶yleyin (Ã¶rneÄŸin \"SHERIFF TO FIRE\" veya \"SHERIFF 61645 - FIRE.\").\r\nâ€¢ HÃ¼kÃ¼meti \"City\" olarak ele alÄ±n\r\nâ€¢ Fire Department\'Ä± \"Fire\" olarak ele alÄ±n\r\nâ€¢ YayÄ±nÄ± direkt, net ve kesintisiz olarak bildirin\r\nâ€¢ Radyo kodlarÄ±nÄ± kullanmayÄ±n\r\nâ€¢ Radyoyu baÅŸka kurumlara ÅŸikayette bulunmak veya haksÄ±z bir durumu bildirmek iÃ§in kullanmayÄ±n\r\n\r\nDepartmanlar arasÄ± frekansÄ± kullanÄ±rken, memurlar:\r\nâ€¢ Ã–zellikle sorulursa cevap verin (isim, seri numarasÄ± vb.)\r\nâ€¢ Departman ile iletiÅŸime geÃ§ilirse Supervisory Staff gÃ¶revde deÄŸilken cevap verin.\r\n\r\nÃ–zel birimlerin departmanlar arasÄ± telsizi bir supervisor tarafÄ±ndan kÄ±lavuz bÃ¶lÃ¼mÃ¼nde belirtilen', '51', '20');
INSERT INTO `factions` VALUES ('4', 'Los Santos Government', '6564391', '7', 'Officer I', 'Officer II', 'Officer III', 'Officer III+1', 'Special Agent', 'National Security Branch Manager', 'ï»¿Intelligence Branch Manager', 'Criminal, Cyber, Response, and Services Branch Manager', 'Chief of Staff', 'Associate Deputy Director ', 'Deputy Director', '[CÄ°A] Director', '[NSA] Sergeant', '[NSA] Lieutenant', '[NSA] Colonel', '[NSA] Staff', '[NSA] Chief Of Staff', '[NSA] Deputy Director', 'BBelediye BaÅŸkan YardÄ±mcÄ±sÄ±', 'Belediye BaÅŸkanÄ±', '0', '0', '0', '0', '50', '1050', '150', '300', '400', '700', '900', '1200', '800', '900', '1000', '900', '1200', '1200', '1400', '2000', 'Radio: 324.842 | Inactivity = Kick | On duty = badge and uniform. | Screenshot vehicles before impound | Minor corruption allowed, major = a kick |', '---- General ----\n- Only HC are supposed to have their own assigned phonenumber.\n- No member is not allowed to keep an income of sales earned.\n- Do not leak any info that is not supposed to get out.\n- Be sure to post in the following thread when you demote/promote/accept/fire/suspend anyone: http://forums.owlgaming.net/showthread.php?8617-Rapid-Towing-High-Command-Arrivals-Departures-Promotions-Demotions-Logbook\n\n\n---- MDC ----\nThis can be used for background checks only.\nName: RapidTow\nPW: rapidtowingleader\n\n\n---- Badge ----\nBe sure to follow the format below.\n/issuebadge id Rapid Towing - Rank - F.Lastname\n\n\n---- Faction Vehicles ----\nFaction vehicles do NOT get purchased without the approval of the CEO or Assistant CEO.\n\nCAR COLOR CODES:\nsetcolor * 000000 00D300\nFirst: 000000\nSecond: 00D300\n\nRapid towing colors:\nsetcolor * 000000 002144\n2nd 002144\n', 'ALL MEMBERS READ THIS IMMEDIATLY.\nhttp://forums.owlgaming.net/showthread.php?13183-Issues\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\n\n---- General Notes ----\n- Received #9021 calls must be answered. Failure to respond will be result in a punishment. We need to show the server that we\'re active!\n- Fuel and fix the vehicles before returning.\n- Only English is allowed in /f. Talking foreign will result in a punishment of 1 hour.\n- Do not restock the dealership unless told by the CEO, Assistant CEO or Sales Manager.\n- Badges are not to be given out unless approved by a faction leader.\n- Upon leaving the faction, badges must be deleted.\n\n\n---- Faction Vehicles ----\n- Buckle up.\n- Lock the doors.\n- Wear your badge and uniform. Failure to wear so will result in a punishment.\n\n\n---- Impounding Cars ----\n- Find an empty space on the first floor.\n- Place it.\n- /park, /handbrake and /setvol 0 it.\n\n\n---- Impounding Bikes ----\n- Use the DFT to bring the bikes inside.\n- Have an administrator /start it.\n- Place it properly on the top floor.\n- /park and /impoundbike it.\n\n\n---- Phonenumbers ----\n- 9022 <-> 9029 = Main Department\n- 9030 <-> 9039 = Instruction Department\n- 9040 <-> 9049 = Sales Department\n\n\n---- Sales Department ----\n- All the money goes to the faction bank. Account name is Rapid Towing, have your reason like this: \"Sales - [Vehicle ID], [Buyer Name]\" (requirement from FMT)\n- You are not allowed to keep a cut of the money. This is an OOC rule which will receive OOC punishment when caught. Keeping cash will result in a kick and a reset of your account.\n- Price: to a non-employee: VehiclePrice x 0.45.\n- Contact for sales department: http://bit.ly/SalesDepartment\n\n\n---- Corruption ----\n- ALLOWED: minor corruption. Example: speeding, drugs.\n- NOT ALLOWED: major corruption. Robbery, kidnapping. Doing it will result in a faction removal.\n\n\n---- Handy Links ----\n- Picture of the 2014 Ford F-350 Towtruck equipped with a stinger towing kit. (more the less) : http://www.southbayford.com/img/layout/towtruck/specPhoto_towtruckF350.jpg\n- The trucks have something similair to this attached to their towing boom (NO HOOK!): http://www.youtube.com/watch?v=V9XVA2rvNek\n- USERGROUP: http://forums.owlgaming.net/profile.php?do=editusergroups\n\n---- Commands ----\n/rbs - Opens the roadblock HUD. \n/nearbyrbs - Find nearby roadblocks and their ID.\n/delrb (ID) - Deletes the roadblock with \'ID\'.\n/ed and add â€¢ $RetailPrice x 0.45\n\n----Student Training & Exams----\nFirst of all, if you\'re a Student, welcome to Rapid Towing, hope your career at this company will be full of positive results.\nNow, this section will be more of a feedback section for all the Students that want to know how this phase works.\nAs a Student you\'re not allowed to go on patrol by yourself neither are you allowed to answer to either Departmental or Hotline calls.\nAs you should know, the Rapid Towing\'s Forum Section has everything you need to successfully pass on your exam. Below this you\'ll find a hand full of links that will help you out:\n- http://forums.owlgaming.net/showthread.php?18403-Rapid-Towing-Student-Handbook-(MUST-READ!)\n- http://forums.owlgaming.net/showthread.php?17337-Rapid-Towing-General-Rules\n- http://forums.owlgaming.net/showthread.php?23340-Rapid-Towing-Official-Parking-Rules\n- http://forums.owlgaming.net/showthread.php?26560-Security-at-Rapid-Towing\n- http://forums.owlgaming.net/showthread.php?19576-Rapid-Towing-Sales-Department\n- http://forums.owlgaming.net/showthread.php?24075-Rapid-Towing-Radio-Usage\n- http://forums.owlgaming.net/showthread.php?27064-Idlewood-Gasstation-towing-not-allowed\n- http://forums.owlgaming.net/forumdisplay.php?729-Unlawful-Impoundment-Reports\n\nOnce you\'ve read those links, I believe you will be almost ready to take your exam.\nAll you need now is to go out on ride-alongs with your partners and ask them any questions you have about the company and how this works.\nBelow you will find a link of what us, Instructors, take in mind in your exams.\n- http://forums.owlgaming.net/showthread.php?31476-Rapid-Towing-Student-Training-amp-Exams&p=194304#post194304\n\n----Probationary Phase----\nCongratulations to all the new Probationary Drivers, this is the part where you will be doing the best you can and will be under eye of other higher ranks.\nFrom now on, you\'re allowed to go on solo patrol and answer to Departmental and Hotline calls.\nNow you have even more responsibility from your acts while on duty.\nDon\'t stick to the fifteen (15) minimum impound mark as it will make your promotion hard to appear as soon as you want. Try getting a higher amount than fifteen (15) impounds.\nKeep your attitude the best. Do not misbehave with any other employee at Rapid Towing nor with customers/civilians.\nRemember to always to pictures (screenshots) if the vehicles you impound with the plates in sight.\nWe expect you to show dedication towards the company.\nThese simple facts will make your future in Rapid Towing positive.\n\n----Behavior/Attitude----\n(( Link is coming soon... ))\n', '90', '20');
INSERT INTO `factions` VALUES ('5', 'Bank of Los Santos', '3382957', '5', 'Guest of Honour', '', '', '', 'Loan Enforcement Officer', 'Junior Loan Enforcer', '', '', '', '', '', '', '', '', '', 'Junior Loan Enforcer', 'Senior Loan Officer', 'Chief Lending Officer', 'Chief Financial Officer', 'Chief Executive Officer', '0', '1', '25', '35', '680', '750', '950', '950', '0', '0', '0', '0', '0', '0', '0', '850', '1000', '1200', '1450', '1500', '#limo', 'Hviid : 321321\nYael : 826 692\nSadiq : 866733\n\n\nSince we do not use our vehicles we are selling them.\nSHO\'s and C63s are for sale at Johnsons Automobiles currently.\nThey are being sold for 50% of their new price, he will however get 10% of the money.\nSo we are getting $22,500($25.000) for the SHO, and $29.250($32.500)  for the Mercedes C63.\n', 'Title Loans Interview Questions - \n\nName:\nPhone Number:\nAddress:\n\nIF VEHICLE:\n\nVehicle Model and Year:\nVIN Number:\nValue of the Car:\nSpeed:\nHandling on Scale of 1-10:\n\n( Offer 50-60 percent of the value of the car, depending on the model and stats. )\n\nIF PROPERTY:\n\nProperty Location:\nProperty Number:\nValue of the Property:\n(( Custom Interior: Yes/No ))\n\n( Ask to view the property. Offer 75-90 percent of what you feel the house can be sold for easily. )\n\n\n!!! Inform people of ther total amount due, number of weekly payments and the sum of each weekly payment. Also inform them that they are not allowed to sell the collateral, nor stat transfer it, as ICly it would have a lien against it and would not be able to be legally sold. !!!\n', null, '20');
