os TV Acil Durum Ã‡aÄŸrÄ±sÄ± â™«â™«â™«â™«â™«â™«\n\ni Åžu anda Los Santos\'ta yaÅŸanan deprem tÃ¼m vatandaÅŸlarÄ±mÄ±zÄ± endiÅŸelendirdi.\ni Uzmanlar yaÅŸanan depremin seviyesini 7.1 olarak belirledi.\ni HÃ¼kumet tekrar yaÅŸanacak bir depremde acil toplanma alanlarÄ±na Ã§adÄ±r yerleÅŸtirmekte.\ni Sheriff mensublarÄ± vatandaÅŸlarÄ±mÄ±zÄ± sakinleÅŸtirmekle meÅŸgul.\ni Åžu anda California civarÄ±nda depremin ÅŸu dakikada tekrar yaÅŸandÄ±ÄŸÄ± sÃ¶yleniyor.\ni Deprem gibi acil durumlar iÃ§in Ã§antanÄ±zÄ± hazÄ±rlamayÄ± unutmayÄ±n.\ni Bol sanÅŸ, Los Santos!\n\ni â™«â™«â™«â™«â™«â™« Los Santos TV Acil Durum Ã‡aÄŸrÄ±sÄ± Sonu â™«â™«â™«â™«â™«â™«\n\n\n\n\r\n/interview name - gÃ¶rÃ¼ÅŸmeye baÅŸlar\r\n/i text - radyo sistemi ile konuÅŸmak\r\n/endinterview name - gÃ¶rÃ¼ÅŸmeyi bitirir\r\n\n', null, '20');
INSERT INTO `factions` VALUES ('7', 'Federal Aviation Administration', '1346527', '2', 'On Leave / Suspended', '[ANG] Airman', '[ANG] Master Sergeant', '[ANG] Lieutenant', '[ANG] Major', 'Trainee', 'Security Guard', 'Crew Chief', 'ATC Officer', 'Agent', 'Special Agent', 'ROT Instructor', 'SER Instructor', 'MER Instructor', 'TER Instructor', 'Chief Investigator', 'Operations Manager', 'Head Instructor', 'FAA Deputy Administrator', 'FAA Administrator', '0', '650', '800', '1000', '1200', '200', '550', '550', '550', '750', '1000', '650', '750', '900', '1100', '1000', '1100', '1200', '1200', '1200', 'Internal channel: 951.159 | Remember to apply to the usergroup on forums! | Going away? Post a inactivity notification @ FAA Staff forum & notify a HC.', '---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\nBadge format:\n\nFAA <Rank> - <F.Lastname>\nExample: FAA Administrator - D.Bryant\n\n\nShort links:\nhttp://tiny.cc/faacareer - Career Apps\nhttp://tiny.cc/flightschool - Flight School apps\nhttp://tiny.cc/flightinstructor - Instructor apps\n\nLos Santos Flight School is looking for instructors! Get free education into a lucrative and challenging job. Apply today! http://www.lossantosflightschool.tk/\n\n', 'NOTICE!: 1- Upon leaving the faction/being kicked or removed from it, you\'ll need to delete your badge and possible uniform.\n              2-Don\'t forget to apply for our Usergroup on the forums!\n\n_____________________________________________________________________________________________________________________\n\nIMPORTANT RULES: whoever break any of these rules will be suspended and charged with a crime.\n1) NO guns are allowed inside the airport field, unless the holder is a cop or FAA Agents+, unauthorized personnels will be charged with crime APC112.\n\n2) Cruisers are NOT allowed outside the airport gate under any reason such as  repairing. \n\n3) NO personal vehicles are allowed to pass from the second gates, ONLY faction vehicles.\n\n4) Driving on the runways will lead to an immediate suspension and charging with crime APC 113.\n\n5) Instructing any kind of pilot licenses or typerating without a valid CFI license will lead to charging crime APC107.\n\n6) NO vehicles are allowed to park on the airport\'s sidewalk.\n\n7) ONLY one vehicle is allowed to park inside the parking area per member.\n\n\n-----to be continued-----\n\n\n', '55', '20');
INSERT INTO `factions` VALUES ('8', 'Los Santos Fire Department', '480983', '2', 'On Leave/Suspended', 'Janitor', '', 'SADLE Special Agent in Training', 'SADLE Special Agent', 'SADLE Supervisory Special Agent', 'SADLE Special Agent in Charge', 'SADLE Commissioner', '', 'Public Relations Officer', 'Special Assistant', 'Public Defender', 'Magistrate Judge', 'Prosecutor In Training', 'Prosecutor', 'Assistant District Attorney', 'District Attorney', 'Attorney General', 'Associate Justice', 'Chief Justice', '0', '250', '0', '700', '800', '900', '1000', '1100', '850', '650', '1000', '0', '650', '600', '650', '700', '900', '1000', '1250', '1500', 'DLE frequency - 132.2 | TS Password = cat', 'BADGE FORMAT:\n[Rank - Individual name]\n\nUse /issuebadge [ID] then the badge format above to issue an individual their badge.\n\nFACTION EXPENSES:\n\n', 'Badges:\n\n1 - Special Agent - #BADGENUMBER\n2 - POLICE || SPECIAL AGENT *Plate Carrier*\n3 - || SADLE/POLICE - \"NICKNAME\" ||\n4 - || POLICE - SPECIAL AGENT ||\n\n1 - General Duty bdge\n2 - Plate Carrier badge\n3 - Rapid Response Team, Marked\n4 - Rapid Response Team, unmarked\n\nRapid Response Team nicknames\n\nMiles Morrison -  \"TAILS\"\nJason Gordon - \"LOCKS\"\nDavid Ellsworth  - \"IRONMAIDEN\"\nDwayne Matheson - \"GRAVEDIGGER\"\n\nRadio Codes:\r\n10-1: Roll Call, all units respond to said location.\r\n10-2: Arrived on scene.\r\n10-3: Negative / No\r\n10-4: Acknowledgement / Affirmative / Yes\r\n10-5: Repeat last transmission\r\n10-6: Stand-by\r\n10-7: Unavailable for calls\r\n10-8: Available for calls\r\n10-9: Suspect Lost (Usually followed by a 10-17 and last known 10-20)\r\n10-10: (Supervisors only) requesting activity update along with giving your current position\r\n10-12: Backup Required (Specify situation and location)\r\n10-13: Requesting specific unit (specify)\r\n10-17: Requesting description on the suspect\r\n10-20: Requesting Location\r\n10-22: Disregard last transmission\r\n10-30: Starting Patrol/Resuming patrol after Code 7\r\n10-31: Returning to Station\r\n10-50: Car accident\r\n10-55: Traffic Stop\r\n10-57 Victor: Vehicle pursuit.\r\n10-57 Foxtrot: Foot pursuit.\r\n10-66: Felony Stop\r\n10-88 Suspicious Person(s)\r\n10-99: Assignment complete (State condition and at what call)\r\n11-99: Officer requires help, Emergency\r\n \r\n \r\n \r\nStatus-codes:\r\nStatus 1: In Service\r\nStatus 2: Out of Service\r\n \r\nIdentity Codes:\r\nIC-1: White\r\nIC-2: Black\r\nIC-3: Latino or Mexican\r\nIC-4: Middle-Eastern\r\nIC-5: Asian\r\nIC-6: Unknown ethnicity.\r\n \r\n \r\nSituation codes:\r\nCode 0: Absolute emergency, drop everything youâ€™re doing and respond immediately.\r\nCode 1: Non-emergency. If you\'re doing something, deal with it first. Respond without lights or sirens.\r\nCode 2: Non-emergency. If you\'re doing something, drop it and respond. Respond with lights only.\r\nCode 3: There is an emergency. Respond with lights and sirens.\r\nCode 4: No assistance required, situation under control.\r\nCode 5: All units stay out of <location>.\r\nCode 6: Out of car at <location>.\r\nCode 7: Meal break.\r\n \r\n \r\nCriminal Codes:\r\n148: Resisting Arrest\r\n187: Homicide\r\n207: Kidnapping\r\n211: Robbery\r\n240: Assault\r\n417: Brandishing a weapon\r\n459: Burglary\r\n487: Petty Theft\r\n602: Trespass/Fraud\n', null, '20');
